import React, { Component } from 'react';
import ReportOption from './ReportOption';
import './controlpanel.css';

class Reports extends Component {

  	handleClick(val) {
  	  	alert('hola');
  	}
  	render() {
  	  	return (  	  		  
  	  		  <div id="ContentPaneldeControl" className="EstiloIconosMenuDashboard" ostype="desktop">
                <div className="titulo">Maestros</div>
                <ul>
                    <ReportOption tab="config0" titulo='Administracion Tipos de Compra' icono="shopping_cart" funcionClick={this.props.funcionClick} componente="PurchaseTypes" />  
                    <ReportOption tab="config1" titulo='Administracion Tipos de Documento' icono="credit_card" funcionClick={this.props.funcionClick} componente="DocumentTypes" />  
                    <ReportOption tab="config2" titulo='Administracion de Usuarios' icono="perm_identity" funcionClick={this.props.funcionClick} componente="Users" />  
                </ul>
            </div> 	
  	  	);
  	}
}

export default Reports
